const RestaurantMenu = () => {
  return (
    <div>
      <h1>Restaurant Name</h1>
      <h2>Menu</h2>
      <ul>
        <li>Biryani</li>
        <li>Manchurian</li>
        <li>Coke</li>
      </ul>
    </div>
  );
};

export default RestaurantMenu;
